import React, { Component } from 'react'

export default class SingleEpisode extends Component {
    render() {
        return (
            <option value={this.props.show.id} key={this.props.show.id} >

                {`${this.props.show.name} - Season: ${this.props.show.season} Episode: ${this.props.show.number} `}
                </option>
        )
    }
}
